import React, { Component } from 'react';

class AddFood extends Component {
  
  constructor(props){
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.state={ 
      userId:"", 
      Name:"",
      videoOne: "",
      videoTwo: ""
    } 
  }

  handleSubmit(event){ 
    event.preventDefault();
    fetch('/', {
     method: 'post',
     headers: {'Content-Type':'application/json'},
        body: JSON.stringify({
        "name": this.state.name,
        "price": this.state.price,
        "quantity": this.state.quantity,
        "purchased": this.state.purchased,
        "expires": this.state.expires,
        "description": this.state.description
        })
    });
   }

  render() {
    return (
      <div className="user-input">
      <br/>
      <h3> Fill out the form below to add a dish! </h3>
      <br/>
        <form onSubmit={this.handleSubmit}>
          <label>Email:</label> <br/>
          <input ref={(ref) => {this.email = ref}} placeholder="User Email" className="textbox" type="text" value={this.state.userId} onChange={(ev)=>this.setState({userId:ev.target.value})} required/>
          <br/>
          <br/>
          <input className="submit" type="submit" value="Submit"/>
        </form> 
      </div>
    );
  }
}

export default AddFood;
